import cover_image from '../assets/cover_image.jpg'

const colors = {
    primary: "#060606",
    background: "#E0E0E0", 
    disbaledd: "#D9D9D9"
}

const Login = () => {
    return (
    <div className="w-full h-screen flex items-start">
     <div className='relative w-1/2 h-full flex flex-col'>
      
      {/* Gambar sebagai background div */}
      <img src={cover_image} className="absolute w-full h-full object-cover z-0" alt="Cover" />

      {/* Teks di depan gambar */}
      <div className='relative z-10 flex flex-col top-[20%] left-[10%]'>
        <h1 className='text-4xl text-white font-bold my-4'>Turn Your Ideas into Reality</h1>
        <p className='text-xl text-white font-normal'>Start for free and get attractive offers from the community</p>
      </div>
    
    </div>
    </div>
    )
}

export default Login;
